import React from "react";
// import {useForm} from 'react-hook-form';
// import loc from '../assets/home/icons/location.png';
// import phone from '../assets/home/icons/phone.png';
// import mail from '../assets/home/icons/mail.png';
// import Footer from '../components/footer';


export default  function Contact () {
    const { register, handleSubmit, formState: { errors } } = useForm();
        const onSubmit = data => console.log(data);
        console.log(errors);
        return(
            <section>

           
            <section>
                <section className="get_in_touch">
                    <h3>Get In Touch!</h3>
                    <h5> Fill up the form and our Team will get back to you within 24 hours.</h5>
                  <button> <img src={loc} alt="Piazza Napoleone"/> <p>Piazza Napoleone, Lucca, Tuscany</p></button>
                  <button> <img src={phone} alt="call to us"/> <p>	+39 346 368 5708</p></button>
                  <button> <img src={mail} alt="send to us"/> <p>	italiainlimo@gmail.com</p></button>
                </section>
                <section>
                    <form onSubmit={onSubmit}>
                            <input placeholder="Name" {...register("Name")}/>
                            <input placeholder="Email" {...register("Email")}/>
    
                            <input type="submit" />
    
    
                     </form>
                   <form>
                         <label> Name and Surname</label>
                         <input placeholder="Enter your name and surname"/>
                         <label> Email Address</label>
                         <input placeholder="Enter your email address"/>
                         <label>Message</label>
                         <textarea placeholder="Enter your Message"/>
                     </form>
                     <button> Send Message</button>
                 </section>
             <section className="interc_map">
    
               </section>
                 <Footer/>
             </section>
            <section>
                <h3>Get In Touch!</h3>
                <h5> Fill up the form and our Team will get back to you within 24 hours.</h5>
            </section>
            </section>
    )
    
}
